import "./home.css"
import Navbar from "./navbar";
function Full(){
    return(
        <>
        <div className="bg">
        <Navbar></Navbar>
        <span className="flex items-center">
  <span className="h-px flex-1 bg-black"></span>
  <span className="shrink-0 px-6">Lorem, ipsum dolor</span>
  <span className="h-px flex-1 bg-black"></span>
</span>
        </div>
        </>
    )
}
export default Full;
